import "./note.css"
import {useEffect, useState} from "react";
import {IsAuth} from '../../isAuth/isAuth'
import { Navigate } from 'react-router-dom';

export const Note = ({text, date}) => {
    return (
        <div className="note">
            <div className="note_info">
                <span>{text}</span>
                <span>{date}</span>
            </div>
            <div className="note_functional">
                <button className="btn_delete">Удалить</button>
            </div>
        </div>
    )
}


export const GetNotes = () => {
    if (!IsAuth()) {
        return <Navigate to='/signup'  />
    }
    // eslint-disable-next-line react-hooks/rules-of-hooks
    const [data, setData] = useState(null)
    // eslint-disable-next-line react-hooks/rules-of-hooks
    useEffect(() => {
        fetch('http://localhost:8000/api/notes/', {'credentials': 'include', 'method': 'GET'})
            .then(res => res.json())
            .then(data => {
                setData(data)
            })
    }, []);
    if (data==null) return <h1>Кажется, у вас нет заметок</h1>
    return (
        <>
            {data.map(note => <Note text={note.text} date={note.date}/>)}
        </>
    )

}
